package com.hlw.entries;

public class Register {
	private String memberphone;
	private String membername;
	private String memberid;
	private String memberregisterdate;
	public Register() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Register(String memberphone, String membername, String memberid, String memberregisterdate) {
		super();
		this.memberphone = memberphone;
		this.membername = membername;
		this.memberid = memberid;
		this.memberregisterdate = memberregisterdate;
	}
	public String getMemberphone() {
		return memberphone;
	}
	public void setMemberphone(String memberphone) {
		this.memberphone = memberphone;
	}
	public String getMembername() {
		return membername;
	}
	public void setMembername(String membername) {
		this.membername = membername;
	}
	public String getMemberid() {
		return memberid;
	}
	public void setMemberid(String memberid) {
		this.memberid = memberid;
	}
	public String getMemberregisterdate() {
		return memberregisterdate;
	}
	public void setMemberregisterdate(String memberregisterdate) {
		this.memberregisterdate = memberregisterdate;
	}
	@Override
	public String toString() {
		return "Register [memberphone=" + memberphone + ", membername=" + membername + ", memberid=" + memberid
				+ ", memberregisterdate=" + memberregisterdate + "]";
	}
	
	
	
}
